import React from 'react'
function Gallery() {
  return (
    <div>
      <>
  <style
    dangerouslySetInnerHTML={{
      __html:
        "
    #main{
        height: 400px;
        width: 1000px;
        border: 8px groove black;
        border-radius: 10px;
        box-shadow: 3px 4px 4px 4px black;
    }
    .img
    {
        height: 200px;
        width: 250px;
        padding: 10px;
        box-shadow: 0px 0px 3px 3px black inset;
        border-radius: 20px;
        margin: 10px;

    }
    #modal
    {
        width: 100%;
        min-height: 750px;
        background-color:rgba(0,0,0,.4);
        position: fixed;
        top:0px;
        display:none;

    }
    #minner
    {
        min-height: 300px;
        width: 600px;
        border-radius: 10px;
        padding: 25px;
        box-sizing: border-box;
        box-shadow: 0px 0px 5px 2px white;
        background: white;
        margin-top: 80px;
    }
    #dmain
    {
        width: 100%;

    }
"
    }}
  />
  <center>
    <h1>IMAGE GALLERY</h1>
    <img src="img/e.jpg" onclick="demo(this)" className="img" />
    <img src="img/gr.jpg" onclick="demo(this)" className="img" />
    <img src="img/manish.jpg" onclick="demo(this)" className="img" />
    <br />
    <img src="img/P.png" onclick="demo(this)" className="img" />
    <img src="img/po.jpg" onclick="demo(this)" className="img" />
    <img src="img/st.png" onclick="demo(this)" className="img" />
    {/*--------startmodal*/}
    <div id="modal">
      <div id="minner">
        <div style={{ textAlign: "center", fontSize: 30 }}>
          IMAGE<b style={{ color: "red" }}>GALLERY</b>
          <a href="modal.html">
            <b style={{ color: "red", fontSize: 25, float: "right" }}>X</b>
          </a>
          <img src="img/th.jpg" id="dmain" />
        </div>
      </div>
    </div>
    {/*--------startmodal*/}
  </center>
</>

    </div>
  )
}

export default Gallery;
